import React from 'react';
import ReactDOM from 'react-dom';
const fname = "Rahul";
const lname = "Rathore";
ReactDOM.render(
  <>
  <h1>My Name is : {`${fname} ${lname}`}</h1>
  </>,
  document.getElementById('root')
);
